import styled from 'styled-components';

export const Title = styled.p`
    margin-top: 0rem;
    color: white;
    font-size: 4rem;
`;

export const UnderTitle = styled.p`
    margin-top: 0rem;
    color: white;
    font-size: 2rem;
`;

export const UnderTitleBlack = styled.p`
    margin-top: 0rem;
    color: black;
    font-size: 2rem;
`;
